export default class Container extends Component() {
  render() {
    return (
      <div><Card {...this.props} /></div>
    )
  }
}

function Card(props) {
  // return <h1>I am functional</h1>

   const images = [
        '../src/assets/blue.png',
        '../src/assets/pink.jpg',
        '../src/assets/plain.png',
        '../src/assets/rasberry.png',
        '../src/assets/sugar.png'
    ];

    return images.map((item) => (
        <div
            className="card"
            key={item.i}
            style={{backgroundImage: `url(${item})`}}
        >
        </div>
    ));
}

